module.exports = /*#__PURE__*/JSON.parse('[{"id":"autocad-civil-engineering","title":"AutoCAD & Civil Engineering Drawing","slug":"autocad-civil-engineering","description":"Master 2D/3D drafting for civil and structural engineering projects used in real Nigerian construction firms.","fullDetails":"This comprehensive 4-week programme covers AutoCAD fundamentals, advanced drawing techniques, annotation, and export workflows used in real Nigerian construction firms. You\'ll learn to create structural drawings, site plans, and construction details that meet industry standards.\\n\\nParticipants work on real project drawings under the guidance of practising engineers, gaining hands-on experience in structural drawing interpretation, dimensioning, layer management, and plotting. By the end of the programme, you\'ll be proficient in producing professional-grade civil engineering drawings ready for site use.","price":25000,"duration":"4 Weeks","mode":"hybrid","startDate":"2026-06-01","seats":30,"seatsAvailable":14,"instructor":"Engr. Seun Adeyemi","flyer":"/placeholder.svg","syllabus":["Week 1: Interface, Setup & Basic Commands","Week 2: 2D Drawing â€” Plans, Sections & Elevations","Week 3: 3D Modelling & Structural Details","Week 4: Annotation, Plotting & Final Project"],"published":true},{"id":"project-management-engineers","title":"Project Management for Engineers","slug":"project-management-engineers","description":"Learn to manage timelines, budgets and teams on construction and engineering projects with PMP-aligned tools.","fullDetails":"This intensive 3-week program equips engineers with PMP-aligned project management tools and methodologies specifically tailored for the construction and building environment. You\'ll learn to develop project schedules, manage budgets, coordinate subcontractors, and deliver projects on time.\\n\\nThe curriculum covers MS Project and Primavera scheduling, cost estimation and control, risk management, stakeholder communication, and quality assurance â€” all taught through case studies from real Nigerian construction projects. Guest speakers from leading construction firms share practical insights on managing complex building projects.","price":30000,"duration":"3 Weeks","mode":"online","startDate":"2026-06-15","seats":50,"seatsAvailable":32,"instructor":"Engr. Amaka Obi","flyer":"/placeholder.svg","syllabus":["Week 1: Project Planning â€” Scope, Schedule & Budgets","Week 2: Execution, Monitoring & Stakeholder Management","Week 3: Closeout, Reporting & PMP Exam Prep"],"published":true},{"id":"structural-analysis-design","title":"Structural Analysis & Design","slug":"structural-analysis-design","description":"Understand structural behaviour, load analysis, and design of reinforced concrete and steel structures.","fullDetails":"This 6-week programme provides a deep understanding of structural engineering principles applied to real building projects. Starting from fundamental concepts of load paths and structural behaviour, you\'ll progress through reinforced concrete design, steel structural design, and foundation engineering.\\n\\nAll design work follows BS/Eurocode standards as applied in Nigerian practice. Participants use industry-standard software for structural analysis and produce design calculations and drawings for real building elements including beams, columns, slabs, and foundations.","price":45000,"duration":"6 Weeks","mode":"physical","startDate":"2026-07-01","seats":25,"seatsAvailable":18,"instructor":"Prof. Chukwuma Nwankwo","flyer":"/placeholder.svg","syllabus":["Week 1: Structural Mechanics & Load Analysis","Week 2: Reinforced Concrete Beam & Slab Design","Week 3: Column & Foundation Design","Week 4: Steel Structural Design","Week 5: Structural Software & Modelling","Week 6: Capstone Design Project"],"published":true},{"id":"site-supervision-management","title":"Construction Site Supervision & Management","slug":"site-supervision-management","description":"Gain practical site supervision skills â€” from setting out to quality control on active construction projects.","fullDetails":"This hands-on 4-week programme is designed for graduate engineers who want to become effective site supervisors. You\'ll learn setting out procedures, concrete volume calculation, material estimation, quality control protocols, and health & safety management on active construction sites.\\n\\nThe programme includes supervised visits to active construction sites in Lagos, where you\'ll observe and participate in real site activities under the mentorship of experienced project engineers. Topics include reading and interpreting structural and architectural drawings, supervising concrete pours, reinforcement checks, and maintaining accurate site records.","price":35000,"duration":"4 Weeks","mode":"physical","startDate":"2026-08-01","seats":20,"seatsAvailable":12,"instructor":"Engr. Tobi Akinwale","flyer":"/placeholder.svg","syllabus":["Week 1: Drawing Interpretation & Setting Out","Week 2: Concrete Works & Reinforcement Supervision","Week 3: Quality Control & H&S Management","Week 4: Site Records, Reporting & Capstone"],"published":true},{"id":"quantity-surveying-estimation","title":"Quantity Surveying & Cost Estimation","slug":"quantity-surveying-estimation","description":"Learn bill of quantities preparation, cost estimation, and contract administration for building projects.","fullDetails":"This 3-week programme covers the fundamentals of quantity surveying and cost estimation for building and civil engineering projects. You\'ll learn to prepare bills of quantities, estimate project costs, evaluate tenders, and manage contract administration.\\n\\nThe curriculum is aligned with Nigerian Standard Method of Measurement and covers both manual takeoff techniques and computer-aided estimation. Real project documents from completed Nigerian construction projects are used throughout the programme for practical exercises.","price":28000,"duration":"3 Weeks","mode":"hybrid","startDate":"2026-09-01","seats":35,"seatsAvailable":28,"instructor":"QS Funmilayo Adegoke","flyer":"/placeholder.svg","syllabus":["Week 1: Measurement & Bill of Quantities","Week 2: Cost Estimation & Tender Evaluation","Week 3: Contract Administration & Variations"],"published":true},{"id":"hvac-mechanical-systems","title":"HVAC & Mechanical Building Services","slug":"hvac-mechanical-systems","description":"Design, install, and maintain HVAC and plumbing systems for commercial and residential buildings.","fullDetails":"This 5-week programme is designed for mechanical engineers who want to specialise in building services. You\'ll learn the design, installation, and maintenance of HVAC systems, plumbing installations, fire protection systems, and mechanical ventilation for commercial and residential buildings.\\n\\nThe programme covers heat load calculations, duct sizing, pipe sizing, equipment selection, and system commissioning. Participants visit active project sites to observe mechanical installations and gain practical experience in system troubleshooting and maintenance.","price":40000,"duration":"5 Weeks","mode":"physical","startDate":"2026-07-15","seats":20,"seatsAvailable":15,"instructor":"Engr. Kayode Balogun","flyer":"/placeholder.svg","syllabus":["Week 1: HVAC Fundamentals & Heat Load Calculation","Week 2: Duct & Pipe Sizing","Week 3: Equipment Selection & System Design","Week 4: Plumbing & Fire Protection Systems","Week 5: Commissioning, Maintenance & Capstone"],"published":true}]');

